import React from "react";
import './Header.css'

const Header = () => {
  return (
    <div className="body">
      <div className="header">
        <img className="main-logo" src={process.env.PUBLIC_URL + '/Img/main-logo.jpg'} alt="" />
        <div className="a">   </div>
        <img className="sub-img1"  src={process.env.PUBLIC_URL + '/Img/sub-img1.jpg'} alt="" />
        <img className="sub-img2"  src={process.env.PUBLIC_URL + '/Img/sub-img2.jpg'} alt="" />
      </div>
    </div>
  )
}

export default Header;
